using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.DependencyInjection;
using MvcStore.Data;
using System;
using System.Linq;
using MvcStore.Models;

public static class SeedData
{
    public static void Initialize(IServiceProvider serviceProvider)
    {
        using (var context = new MvcStoreContext(serviceProvider.GetRequiredService<DbContextOptions<MvcStoreContext>>()))
        {
            if (context.Product.Any())
            {
                return; // DB has been seeded
            }
            context.Product.AddRange(
                new Product
                {
                    Name = "headphone",
                    Description = "very good",
                    Color = "brown",
                    ImageUrl = "",
                    Price = 100
                },new Product
                {
                    Name = "mouse",
                    Description = "gaming",
                    Color = "rgb",
                    ImageUrl = "",
                    Price = 5
                },new Product
                {
                    Name = "laptop",
                    Description = "ssd 2TB",
                    Color = "black",
                    ImageUrl = "",
                    Price = 300
                },new Product
                {
                    Name = "Robot",
                    Description = "like human",
                    Color = "white",
                    ImageUrl = "",
                    Price = 1000
                }
                );
            context.SaveChanges();
        }
    }
}